import React from 'react';
import './App.css';
import Navbar from './Components/Navbar';
import { Router } from 'react-router';
import Login from './Components/Login';
function App() {
  return (
    <React.Fragment>
      <Navbar/>
      <Router>
        <Route path = '/login'>
          <Login></Login>
        </Route>
      </Router>
    </React.Fragment>
  );
}

export default App;
